(1, 'Mohammad Yousuf Zehadi', NULL, 'N/A', '01404408836', 'zehadi@fashion-product.com', '145906.png', '2013-02-17', '145906', '14', '6', '5', 'Male', 'Islam', 'Bangladesh', '6861118856', '6861118856', '8', 'Active', '1978-07-31', '1', 'O+', 'mohammad-yousuf-zehadi', '2023-10-05 04:42:02', '2023-10-05 05:31:32', NULL),
(2, 'Md. Tanvirul Islam', 'This is Md. Tanvirul Islam I’m creative, artistic and ambitious fashion designer with a talent for thinking outside the box and coming up with innovative ideas and design. I have excellent communication skills, enabling me to effectively communicate with a wide range of people.', 'N/A', '01854834444', 'tanvir@fashion-product.com', '202921.png', '2023-07-08', '202921', '18', '5', '5', 'Male', 'Islam', 'Bangladesh', '8704614471', '8704614471', '8', 'Active', '1998-04-19', '1', 'A+', 'md-tanvirul-islam', '2023-10-05 04:47:26', '2023-10-05 05:31:20', NULL),
(3, 'Abdullah Al Mamun', 'I am a friendly and outgoing individual with a passion for learning and personal growth. I have a strong work ethic and always strive to give my best effort in everything I do. I am a quick learner and enjoy taking on new challenges. I am also a great team player and enjoy collaborating with others to achieve common goals. Overall, I am a positive and motivated individual who is always looking for opportunities to grow and improve.', 'N/A', '01404408843', 'mamun.accounts@fashion-product.com', '140806.png', '2012-01-14', '140806', '4', '7', '5', 'Male', 'Islam', 'Bangladesh', '1592827934797', '1592827934797', '3', 'Active', '1983-07-01', '1', 'O-', 'abdullah-al-mamun', '2023-10-05 04:50:46', '2023-10-05 05:31:10', NULL),
(4, 'Gazi   Salah Uddin Md. Shahidulalh', 'I have been working as a senior executive (Commercial) for the past 7 years in our valued company. I try to the best my potential skills to do something innovative & creative in supply chain related field. I try to follow the 7 C’s: Correctness, Clarity, Conciseness, Completeness, Consideration, Concreteness & Courtesy.', 'www.linkedin.com/in/salahuddinsadi', '01404408896', 'sadi@fashion-product.com', '10183.png', '2016-08-01', '10183', '6', '7', '5', 'Male', 'Islam', 'Bangladesh', '1520804945877', '1520804945877', '8', 'Active', '1984-05-21', '1', 'O+', 'gazi-salah-uddin-md-shahidulalh', '2023-10-05 05:08:13', '2023-10-05 05:30:57', NULL),
(5, 'Rezaul Amin', 'I am Rezaul Amin. I am ambitious and driven. I am passionate about my work. Because I love what I do. I love meeting new people  and learning about their lives and their backgrounds. I can almost always find common ground with strangers and I like making people feel comfortable in my presence. I am organised. I always take notes. I like to keep a clean workspace and create a logical filing method so I am always able to find what I need. I like Music.', 'N/A', '01404408839', 'amin@fashion-product.com', '162890.png', '2015-06-01', '162890', '4', '2', '5', 'Male', 'Islam', 'Bangladesh', '6901026416', '6901026416', '9', 'Active', '1979-05-20', '1', 'A+', 'rezaul-amin', '2023-10-05 05:12:31', '2023-10-05 05:29:21', NULL),
(6, 'Kazi Md. Shahnewas', 'Nature and history lover , innovative thinker , dedicated to work.', 'N/A', '01404408821', 'shahnewas@fashion-product.com', '202918.png', '2023-07-08', '202918', '14', '13', '5', 'Male', 'Islam', 'Bangladesh', '7758730175', '7758730175', '8', 'Active', '1985-02-12', '1', 'A+', 'kazi-md-shahnewas', '2023-10-05 05:16:09', '2023-10-05 05:28:59', NULL),
(7, 'Md. Whidul Islam', 'Highly experienced as dynamic, motivated & results-oriented Senior Executive- Accounts at JMS Group. Accomplished Team Leader- Finance with over 10 years impressive track record in large MNC. Skilled in Accounts Payable Management, Bank reconciliation, reporting & analysis and ERP software. Always get in interested to take new responsibilities & challenges to achieve the company’s goals as well as develop my career.', 'https://www.linkedin.com/in/whidul-islam-aa6663204', '01404408849', 'whid@fashion-product.com', '100201.png', '2023-01-08', '100201', '4', '7', '5', 'Male', 'Islam', 'Bangladesh', '5054364376', '5054364376', '8', 'Active', '1979-02-01', '1', 'O+', 'md-whidul-islam', '2023-10-05 05:20:19', '2023-10-05 05:20:19', NULL),
(8, 'Abu Jafor Md. Yousuf', 'Innovative thinker, dedicated to work', 'N/A', '01404408895', 'abujafor@fashion-product.com', '10041.png', '2004-09-02', '10041', '6', '2', '5', 'Male', 'Islam', 'Bangladesh', '3263153219', '3263153219', '8', 'Active', '1976-01-21', '1', 'AB+', 'abu-jafor-md-yousuf', '2023-10-05 05:24:14', '2023-10-05 05:27:46', NULL),
(9, 'Supon Mazumder', NULL, 'N/A', '01404408838', 'supon@fashion-product.com', '10147.png', '2010-10-20', '10147', '4', '7', '5', 'Male', 'Hinduism', 'Bangladesh', '5536501702', '5536501702', '8', 'Active', '1981-11-12', '1', 'A+', 'supon-mazumder', '2023-10-05 05:34:46', '2023-10-05 05:34:46', NULL),
(10, 'Sajedur Rahman', 'This is Sajedur Rahman. I am a highly skilled professional merchandiser with an impressive 09-year career in the fashion industry, Buying, trading, and sourcing office. Also, I have extensive knowledge of managing and improving end-to-end merchandising procedures to increase sales and profit. Committed to improving brand presence and providing outstanding client experiences through creative and effective merchandising tactics.', 'N/A', '01404408825', 'sajedur@fashion-product.com', '202923.png', '2023-07-08', '202923', '14', '13', '5', 'Male', 'Islam', 'Bangladesh', '1515395404664', '1515395404664', '8', 'Active', '1988-12-28', '1', 'O+', 'sajedur-rahman', '2023-10-05 05:41:43', '2023-10-05 05:41:43', NULL),
(11, 'Sabrina Anjuman', 'I am flexible and can adapt to new situations and changes quickly and easily. I have a friendly personality and  People can see that I am authentic and honest. I am a hard worker and am always putting in the extra effort to achieve my goals, both in in work and in my  personal life.', 'N/A', '01914894294', 'sabrina@fashion-product.com.bd', '110884.png', '2006-08-01', '110884', '4', '7', '5', 'Female', 'Islam', 'Bangladesh', '4630412718', '4630412718', '8', 'Active', '1977-12-05', '1', 'B+', 'sabrina-anjuman', '2023-10-05 05:45:19', '2023-10-05 05:45:19', NULL),
(12, 'Mohammed Sarwar Kamal Chowdhury', 'I am  Md Sarwar Kamal Chowdhury. I working in this company last 15 years.  I enjoy working with JMS Group. I am punctual, energetic, dependable and can be counted upon to finish what I start. I tried my level best to fulfil the required responsibility and other task that has been given to me. I wish all the very best to   improvement  our Company day by day.', 'https://www.linkedin.com/in/mohammed-sarwar-kamal-chowdhury-596b4425a/', '01404408840', 'kamal@fashion-product.com', '114483.png', '2008-10-25', '114483', '4', '1', '5', 'Male', 'Islam', 'Bangladesh', '6885517919', '6885517919', '8', 'Active', '1974-10-12', '1', 'A+', 'mohammed-sarwar-kamal-chowdhury', '2023-10-05 05:48:07', '2023-10-05 05:48:07', NULL),
(13, 'Md. Anayet-e-rabbi', 'I Always try to Company’s passion Development  to ensure the  success.', 'N/A', '01404408846', 'rabbi@fashion-product.com.bd', '10060.png', '2000-04-17', '10060', '4', '7', '5', 'Male', 'Islam', 'Bangladesh', '1462839133', '1462839133', '5', 'Active', '1977-07-01', '1', 'B+', 'md-anayet-e-rabbi', '2023-10-05 05:52:45', '2023-10-05 05:52:45', NULL),
(14, 'Md. Toaha Bin Amin', NULL, 'https://bd.linkedin.com/in/metoahaamin', '018160099614', 'toaha@fashion-product.com', '10196.png', '2022-01-01', '10196', '6', '8', '5', 'Male', 'Islam', 'Bangladesh', '19901510882000078', '19901510882000078', '8', 'Active', '1990-12-01', '1', 'A+', 'md-toaha-bin-amin', '2023-10-05 05:56:32', '2023-10-05 05:56:32', NULL),
(15, 'Saif Uddin Ahemd', 'I am Saifuddin Ahmed.I am working as an executive in JMS Group.I am particularly inspired by the office environment and the cooperation of colleagues.Our MD Sir (Mostafa Mahmud) is very honest man and religious Man.GM Sir (Aziz Uddin Ahmed Also Kind Man. Seeking a position with a financial institution for advisory on budgeting and profitability. Analytical and innovative finance professional, offering over 3 years\' professional experience with established expertise in risk and assets management.', 'https://www.linkedin.com/in/saif-uddin-ahmed-0374b4202', '01404408845', 'saifuddin@fasion-product.com', '100200.png', '2022-12-18', '100200', '4', '8', '5', 'Male', 'Islam', 'Bangladesh', '1927075703', '1927075703', '2', 'Active', '1995-11-10', '1', 'AB+', 'saif-uddin-ahemd', '2023-10-05 06:03:54', '2023-10-05 06:07:20', NULL),
(16, 'Nazam Uddin', 'I born at Chittagong in Muslim family, I had started working since 2000 and doing Merchandising till now. it is very interesting Job. i enjoy to work in my profession very much', 'N/A', '01404408835', 'nazam@fashion-product.com', '198032.png', '2021-12-26', '198032', '14', '2', '5', 'Male', 'Islam', 'Bangladesh', NULL, NULL, '8', 'Active', '1976-11-28', '1', 'O+', 'nazam-uddin', '2023-10-05 06:10:37', '2023-10-05 06:10:37', NULL),
(17, 'Md. Abdul Momit', 'I am Mumit. I always try to utilize my skills, abilities & experience to ensure the company’s success. To build up the career in a challenging environment where hard work, strict discipline, creative work & problem solving is cornerstone of success.', 'https://www.linkedin.com/in/md-abdul-mumit', '01647104032', 'mumit@fashion-product.com.bd', '100213.png', '2023-08-01', '100213', '6', '8', '5', 'Male', 'Islam', 'Bangladesh', '2853160139', '2853160139', '8', 'Active', '1998-06-07', '1', 'O+', 'md-abdul-momit', '2023-10-05 06:13:56', '2023-10-05 06:13:56', NULL),
